import React, {useState, useEffect} from "react";
import { useDispatch, useSelector } from 'react-redux';
import { loginUser } from './actions';

function Registration (props) {

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [secondPassword, setSecondpassword] = useState('');

    function sendValues() {
        if (!email && email == "") {
            window.alert("Поле емейл не може бути порожнім");
            return;
        }
        if (!password && password == "") {
            window.alert("Поле паролю не може бути порожнім");
            return;
        }
        if (!secondPassword && secondPassword == "") {
            window.alert("Паролі повинні збігатись");
            return;
        }
    }

    return (
        <div className="registrationPage">
            <form>
                <div className="form-group row">
                    <label>
                        Емейл
                    </label>
                    <input type="text" className="form-control" onChange={(event) => setEmail(event.target.value)} reguired/>
                </div>
                <div className="form-group row">
                    <label>
                        Пароль
                    </label>
                    <input type="text" className="form-control" onChange={(event) => setPassword(event.target.value)} reguired/>
                </div>
                <div className="form-group row">
                    <label>
                        Повторіть пароль
                    </label>
                    <input type="text" className="form-control" onChange={(event) => setSecondpassword(event.target.value)} reguired/>
                </div>
                <div className="form-group row">
                    <input type="button" id="registrateBtn" className="btn btn-primary linkButton" value="Зареєструватись" onClick={sendValues}/>
                </div>
            </form>
        </div>
    );
}

export default Registration;
